description:
Bugs fixed:

a) when processing a command like: WinRAR.exe a -sfxmymodule.sfx arcname.exe WinRAR ignored the optional parameter of -sfx switch and used default.sfx module. Console RAR.exe did not have this bug; 

b) WinRAR did not create the folder structure necessary to store unpacked hard links. So if folder containing a hard link did not exist yet, hard link extraction failed; 

c) &quot;rn&quot; command displayed wrong file names for processed files. Files were renamed properly, only the screen output was incorrect; 

d) when extracting ACE archive, WinRAR could create empty folders contained in such archive in a wrong destination folder.
